    "daily_data <- daily_data %>% mutate(WeightType = case_when(\n",
    "  BMI < 18.5 ~ 'Underweight',\n",
    "  BMI >= 18.5 & BMI <= 24.9 ~ 'Healthy',\n",
    "  BMI >= 25 ~ 'Overweight'\n",
    ")) \n",
    "\n",
    "head(daily_data[!is.na(daily_data$WeightType), ])"
   ]
  },
