   "source": [
    "There are two ways in which i can classify the activity levels of days,either by using their ActiveMinutes or steps taken in each of the day. The latter is much easier. \n",
    "\n",
    "Based on studies and general guidelines, activity levels based on steps taken in a day can be classified as follows:\n",
    "\n",
    "1. Sedentary: Less than 5,000 steps per day.\n",
    "2. Lightly Active: 5,000 to 7,499 steps per day.\n",
