   "source": [
    "days_classification <- function(row){\n",
    "    veryActive <- as.double(row[\"VeryActiveMinutes\"])\n",
    "    fairlyActive <- as.double(row[\"FairlyActiveMinutes\"])\n",
    "    lightlyActive <- as.double(row[\"LightlyActiveMinutes\"])\n",
    "    sedentaryActive <- as.double(row[\"SedentaryMinutes\"])\n",
    "    \n",
    "    moderatelyActive <- fairlyActive + lightlyActive\n",
    "    if((veryActive > 32) || (fairlyActive > 64) || (moderatelyActive > 300)){\n",
    "        return(\"VeryActive\")\n",
    "    } else if(((veryActive > 21) && (veryActive < 33)) || ((moderatelyActive > 149) && (moderatelyActive < 301))){\n",
    "        return(\"FairlyActive\")\n",
    "    } else if(((veryActive > 10) && (veryActive < 21)) || ((moderatelyActive > 49) && (moderatelyActive < 150))){\n",
    "        return(\"LightlyActive\")\n",
    "    } else if(moderatelyActive < 50){\n",
    "        return(\"Sedentary\")\n",
    "    } else {\n",
    "        return(\"Sedentary\")\n",
    "    }\n",
    "}\n",
    "\n",
    "day_classification_by_steps <- function(rows){\n",
    "    steps <- as.double(rows['TotalSteps'])\n",
    "    if (steps < 5000) {\n",
    "        return(\"Sedentary\")\n",
    "      } else if ((steps < 7500) && (steps > 5000)) {\n",
    "        return(\"LightlyActive\")\n",
    "      } else if (steps < 10000) {\n",
    "        return(\"FairlyActive\")\n",
    "      } else if (steps > 10000) {\n",
    "        return(\"VeryActive\")\n",
    "      } else {\n",
    "        return(\"HighlyActive\")\n",
    "      }\n",
    "}\n",
    "        \n",
    "daily_data$day_type <- apply(daily_data,1,day_classification_by_steps)\n",
    "head(daily_data)"
   ]
