   "source": [
    "weekday_distribution <- data.frame(table(daily_data$day_type, daily_data$Weekday))\n",
    "\n",
    "\n",
    "colnames(weekday_distribution) <- c(\"day_type\", \"Weekday\", \"Count\")\n",
    "\n",
    "\n",
    "ggplot(weekday_distribution, aes(x = Weekday, y = Count, fill = day_type)) +\n",
    "  geom_col(position = \"dodge\") +\n",
    "  labs(title = \"Day Type Distribution Across Weekdays\", x = \"Weekday\", y = \"Count\", fill = \"Day Type\") +\n",
    "  theme(plot.margin = margin(1, 1, 1, 1, \"cm\"))"
   ]
