   "source": [
    "weekday_percentage <- daily_data %>%\n",
    "  group_by(Weekday, day_type) %>%\n",
    "  summarise(Count = n()) %>%\n",
    "  mutate(Percentage = (Count / sum(Count)) * 100)\n",
    "\n",
    "\n",
    "ggplot(weekday_percentage, aes(x = Weekday, y = Percentage, fill = day_type)) +\n",
    "  geom_bar(stat = \"identity\") +\n",
    "  labs(title = \"Percentage of Activity Level by Weekday\", x = \"Weekday\", y = \"Percentage\", fill = \"Activity Level\") +\n",
    "  geom_text(aes(label = paste0(round(Percentage, 1), \"%\")), position = position_stack(vjust = 0.5), size = 4) +\n",
    "  theme(plot.title = element_text(size = 16), axis.text = element_text(size = 12), legend.text = element_text(size = 12)) +\n",
    "  theme(plot.background = element_rect(fill = \"white\"),\n",
    "        panel.background = element_rect(fill = \"white\"))"
   ]
  },
